  \"Aleutian Canada goose surveys in Near Islands (Agattu and Nizki): Preliminary
  report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:04.528994\",\n\t\"name\":
  \"aleutian-canada-goose-surveys-in-near-islands-agattu-and-nizki-preliminary-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Three observers disembarked the 86' charter
  vessel Western Pacific near the east end of Nizki Island 23 May 1983. The goal of
  the field camp was to observe Aleutian Canada geese and inventory all migratory
  bird populations on the islands for the first time since introduced foxes were eliminated
  from the island in the late 1970s. On 23 May, two observers were placed in a field
  camp at Aga Cove Aggatu Island, for the purpose of locating and observing returning
  Aleutian Canada geese through 3 June 1983. In total, geese were sighted 100 times.
  Thirty-three sightings were rebanded birds where the band numbers could be read
  and recorded. Seventeen sightings were of unbanded birds. Six were of birds known
  to have bands, which were unreadable. The remainder were of birds observed under
  circumstances which precluded determination of banding status. One pair of leg and
  other bones was also found near Cape Sabak. Evidence suggested the bird died shortly
  after being transplanted to Agattu from Buldir last summer.\",\n\t\"license_title\":
